export const anotherName = (name) =>{
    return (dispatch)=>{
        fetch("https://jsonplaceholder.typicode.com/posts?userId=1")
        .then(res=>res.json())
        .then(res2=>{
            dispatch({type: 'CHANGE_NAME',payLoad: res2[1].name})
        })
    }
}
